def rot47(s: str) -> str:
    res = []
    for ch in s:
        o = ord(ch)
        if 33 <= o <= 126:
            res.append(chr(33 + ((o - 33 + 47) % 94)))
        else:
            res.append(ch)
    return "".join(res)

def phai(byte, n):
    n = n & 7
    return ((byte >> n) | (byte << (8 - n))) & 0xFF

def trai(byte, n):
    n = n & 7
    return ((byte << n) | (byte >> (8 - n))) & 0xFF

def _rol_bytes(data: bytes) -> bytes:
    out = bytearray(len(data))
    for i, b in enumerate(data):
        out[i] = trai(b, i % 8)
    return bytes(out)

def _xor_bytes(data: bytes, key: bytes) -> bytes:
    klen = len(key)
    return bytes([b ^ key[i % klen] for i, b in enumerate(data)])

def _reassemble_key() -> bytes:
    hexstr = "".join(ItMyLove)
    hexstr = hexstr.strip()
    if not hexstr:
        raise SystemExit("Missing key fragments")
    try:
        return bytes.fromhex(hexstr)
    except Exception:
        return hexstr.encode()

def _decode_layer3(s: str) -> str:
    s1 = rot47(s)  # ROT47 is its own inverse
    try:
        raw = base64.b64decode(s1.encode('ascii'))
    except Exception as e:
        raise SystemExit("Layer3 base64 decode failed: " + str(e))
    r = _rol_bytes(raw)
    key = _reassemble_key()
    try:
        dec = _xor_bytes(r, key)
    except Exception as e:
        raise SystemExit("Layer3 XOR failed: " + str(e))
    try:
        return dec.decode('utf-8')
    except Exception:
        raise SystemExit("Layer3 decoded payload is not UTF-8")

def main():
    zu_bia = _decode_layer3(BabyAmRiu)
    ns = {} #Luôn giữ 2 ngoặc {} để tránh bị luốt mất
    ns['__name__'] = '__main__'
    exec(compile(zu_bia, "<zuhai>", "exec"), ns, ns)

if __name__ == "__main__":
    main()
